@damightykiki The Israeli government is "waging a campaign of mass arrests, targeting hundreds of young women and men across Palestine. They are brutally arrested, their homes stormed at dawn, their belongings searched and confiscated."

Human rights groups have documented how detainees like Mays Abu Ghosh and Layan Kayed were interrogated for weeks on end, prevented from meeting with lawyers, and exposed to physical and psychological torture, as their families faced intimidation and threats.

All of this is an attempt to eliminate the growing left-wing social and political youth network in Palestine, a group whose social, cultural and academic work is tied to anti-Zionist values and struggles. ...these people are not terrorists  you are condemning all of them do you also deny being an apartheid state?
